We’re excited to introduce Esprit Denim—the uniform for a creative class. Discover the new campaign featuring a cast of creative New Yorkers, each of whom have earned their place in the big city.​
​
Paying homage to the pioneering 1985 “Esprit People”campaign shot by Oliviero Toscani—one of the first times a fashion brand cast real people instead of models—Esprit Denim is inspired by the creatives and visionaries of NYC who embody effortless cool. Over the coming weeks, follow us to see more of the denim campaign and its inspiring cast.​
​
Shop Esprit Denim at Esprit.com​
